import React, { Fragment } from 'react';
import styled from 'styled-components';

import ReactCompareImage from '../Partials/ReactCompareImage';

const Container = styled.div`
	background-image: url('assets/images/feature.png');
	background-repeat: no-repeat;
	background-position: bottom center;
	height: 700px;
	width: 1280px;
	text-align: center;
	padding-top: 44px;
`;

const feature = (props) => (
	<Fragment>
		<Container>
			<ReactCompareImage
				className="test"
				leftImage="assets/images/jbl-xtreme_l.png"
				rightImage="assets/images/jbl-xtreme_r.jpg"
				sliderPositionPercentage={0.25}
				sliderLineWidth={1}
			/>;
		</Container>
	</Fragment>
)

export default feature;
